import React, {useState} from 'react'
import {Form, Input, Button} from 'antd';
import {UserOutlined, LockOutlined} from '@ant-design/icons';

const RegisterForm = () => {

    const [email, setEmail] = useState('')
    const [password, setPassword] = useState('')
    const [firstName, setFirstName] = useState('')
    const [lastName, setLastName] = useState('')

    const sendForm = (e) => {
        console.log(e);
    }

    return (
        <div className="register-from">
            <Form onFinish={sendForm}>

                <Form.Item hasFeedback name="firstName"
                    rules={
                        [{
                                required: true,
                                message: 'Please input your first name!'
                            }]
                }>
                    <Input value={firstName}
                        onChange={
                            (e) => setFirstName(e.currentTarget.value)
                        }
                        prefix={
                            <UserOutlined
                        className="site-form-item-icon"/>
                        }
                        placeholder="First Name"
                        allowClear/>
                </Form.Item>

                <Form.Item hasFeedback name="lastName"
                    rules={
                        [{
                                required: true,
                                message: 'Please input your last name!'
                            }]
                }>
                    <Input value={lastName}
                        onChange={
                            (e) => setLastName(e.currentTarget.value)
                        }
                        prefix={
                            <UserOutlined
                        className="site-form-item-icon"/>
                        }
                        placeholder="Last Name"
                        allowClear/>
                </Form.Item>

                <Form.Item hasFeedback name="email"
                    rules={
                        [{
                                required: true,
                                message: 'Please input your email!'
                            }]
                }>
                    <Input value={email}
                        onChange={
                            (e) => setEmail(e.currentTarget.value)
                        }
                        prefix={
                            <UserOutlined
                        className="site-form-item-icon"/>
                        }
                        placeholder="Email"
                        allowClear/>
                </Form.Item>

                <Form.Item hasFeedback name="password"
                    rules={
                        [{
                                required: true,
                                message: 'Please input your Password!'
                            }]
                }>
                    <Input value={password}
                        onChange={
                            (e) => setPassword(e.currentTarget.value)
                        }
                        prefix={
                            <LockOutlined
                        className="site-form-item-icon"/>
                        }
                        type="password"
                        placeholder="Password"
                        allowClear/>
                </Form.Item>

                <Form.Item>
                    <Button type="primary" htmlType="submit" className="login-form-button">
                        Register
                    </Button>
                </Form.Item>
            </Form>
        </div>
    )
}

export default RegisterForm
